import React, { useEffect, useState } from "react";
import "./style.css";

export default function Episode(props) {
    useEffect(() => {

    })
    function onChangeEp(){
        props.setEpisode({sv:0,ep:props.epKey});
    }
    return (
        <li onClick={()=>{onChangeEp()}} className={"episode " + (props.active && "active")}>
            <span>{props.data.label}</span>
        </li>
    );

}
